import React from "react";
import { Link} from "react-router-dom";

const Navbar = () => {
    return (
        <nav className="navbar navbar-dark bg-dark mb-4 d-flex justify-content-center">
            <div className="navbar-brand mb-3 d-inline-flex p-4">
                <div className="d-flex flex-column">
                    <Link to={`/`} className="btn text-light"><h1><strong>E-Commerce</strong></h1></Link>
                    <div className="d-flex justify-content-around">
                        <Link to={`/add-item`} className="btn btn-light float-left">
                            Create item
                        </Link>
                        <Link to={`/cart`} className="btn btn-light float-right">
                            <i className="fas fa-shopping-cart"></i>
                        </Link>
                    </div>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
